import React from 'react';
import './App.css';
import { Typography } from 'antd';
import { Input, Select, Button, Row, Card, Table } from 'antd';
import 'antd/dist/antd.css';

const { Option } = Select;
const { Title } = Typography;
const { Search } = Input;

const buttonAfter = (
    <Button type="primary" icon="plus">
      Add
    </Button>
);


const dataSource = [
  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];



function App() {
  return (
    <div>
      <Title>Steam Group Game Checker</Title>


        <Card title="Search for common games"  style={{ width: 500 }}>
          <Search
              addonBefore={"Steam Id:"}
              placeholder="Please enter a Steam Id..."
              enterButton={buttonAfter}
              size="large"
              onSearch={value => console.log(value)}
              style={{marginBottom: 16}}
          />




          <Row type="flex" justify="end">
          <Button type="primary" icon="search">
            Search
          </Button>
          </Row>

          <Table dataSource={dataSource} columns={columns} />;
        </Card>
    </div>
  );
}

export default App;
